sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.statusCode != "200") {
        new GCPPubSubErrorHandling().topicErrorHandling(inputs, outputs);
        return;
    }
    outputs.status = "Success";
   outputs.messageids = JSON.parse(inputs.responseBody).messageIds;
})(inputs, outputs);

