sys_variable_value.value:
(function execute(inputs, outputs) {
    var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["projectid", "name"]);
    pubSub.maptoOutputFromInput(inputs, outputs, ["projectid", "name"]);
    var payload = {
        "messages": []
    };
    inputs.messages.forEach(function(message) {
        var messageBody = {};
        if (message.messagecontent.trim()) {
            messageBody["data"] = gs.base64Encode(message.messagecontent.trim());
            var messageAttribute = pubSub.arrayObjecttoObject(message["attributes"]);
            if (messageAttribute) {
                messageBody["attributes"] = messageAttribute;
            }
        }
        if (messageBody["data"])
            payload["messages"].push(messageBody);
    });
  if (payload["messages"].length < 0)
    throw new Error("Atleast one message content is required");
    outputs.messages = JSON.stringify(payload);
})(inputs, outputs);

